package de.fivethree.immoapps.backend.model.csv;

public class FileRep {
    private String fileName;

    private byte[] data;

    public FileRep(String fileName, byte[] data) {
        this.fileName = fileName;
        this.data = data;
    }

    public String getFileName() {
        return fileName;
    }

    public byte[] getData() {
        return data;
    }
}
